export class SelectedColor extends Component {
    constructor(props) {
        super(props);

    }

    render() {

        console.log(this.props.selectColors)
        if(this.props.selectColor !== []) {
            return this.props.selectColor.map((data) => (
                <div>
                <div >{data.name}</div>
            </div>
            )) 
        }



    }
}

export default SelectedColor
